import{ createMuiTheme } from '@material-ui/core/styles';
import { common } from '@material-ui/core/colors';

const themeApp = CreateMUiTheme({
    typography : {
        useNextVariants: true
    },
    palette : {
        primary : {
            main: '#10a75f'
        },
        common:{
            white : 'white'
        },
        secondary:{
            main: '#e53935'
        }
    },
    spacing : 10
})
